Sometimes we will want to supply arguments to our program when we run it. We can access these using the optional argc and argv parameters in main. int main(int argc, char** argv)
{ ...
} argc is the number of arguments supplied. argv is an array of c-strings containing our arguments. Note: the first argument (argv[0]) is the command used to run the program. Let's create a program to add together two numbers. You can modify your main.cpp or create a new .cpp file, just make sure to compile the correct file when you are finished. Firstly, let's make sure the user gave us enough arguments. #include <stdio.h> int main(int argc, char** argv)
{ if(argc <= 2) return 1; // error exit status return 0;
} It might help the user if we give them a message when they supply the wrong arguments. To do this, we can use argv[0]. It is important to mention that the if statemtnt can have it's own block. For now, all you need to know is that it can only hold one statement unless we give it a block. #include <stdio.h> int main(int argc, char** argv)
{ if(argc <= 2) { printf("Usage: %s <number> <number>", argv[0]); return 1; } return 0;
} The '%s' here tells printf to print a string argument, in this case argv[0]. Try compiling this and running it without any arguments. After we know we have the correct number of arguments, we can start using them. We will assume the arguments are both numbers containing only digits for the sake of simplicity. We need another include for string conversion functions. #include <stdio.h>
#include <stdlib.h> int main(int argc, char** argv)
{ if(argc <= 2) { printf("Usage: %s <number> <number>", argv[0]); return 1; } float a = atof(argv[1]); float b = atof(argv[2]); printf("%f + %f = %f\n", a, b, a + b); return 0;
} As with '%s', '%f' tells printf to print an argument, but in this case it is a float (aka a 'real'), which is a decimal number.

