Getting input from the console can be complicated. We need to create an empty string as well as values to store it's initial length. We then pass this to getline, which has the following signature: ssize_t getline(char** lineptr, size_t* n, FILE* stream); This function will return the number of characters in the string, or -1 if it fails. Let's modify our addition program to use stdin instead of command line arguments. #include <stdio.h>
#include <stdlib.h> int main()
{ for(;;) // loop forever { char* in_a = NULL; // string for first argument size_t len_a = 0; // initial length printf("Enter a number: "); // getline call // 'stdin' is the file stream for console input if(getline(&in_a, &len_a, stdin) < 0) { // clean up the string free(in_a); // exit return 0; } char* in_b = NULL; size_t len_b = 0; printf("Enter a number: "); if(getline(&in_b, &len_b, stdin) < 0) { free(in_b); // exit return 0; } float a = atof(in_a); float b = atof(in_b); printf("%f + %f = %f\n", a, b, a + b); // clean up the strings free(in_a); free(in_b); } } As you can see, this program has no end point - it loops forever. To exit, either use ctrl-c to kill the program from the terminal, or ctrl-d to send an EOF (end of file) character, which will cause getline to fail (which we catch inside the if statements).

