At some point, the day will come when you need to read or write a file. We can't rely on the disk giving us the data correctly, so there is a lot of error handling involved. TL;DR: this is going to sting a bit. No matter what we do with a file, we need to open it first. The only difference is the mode used to open the file. Mode Name Description If file exists If file does not exist "r" read Open a file for reading Read from start Fail to open "w" write Create a file for writing Destroy contents Create new "a" append Append to a file Write to end Create new "r+" read extended Open a file for read/write Read from start Error "w+" write extended Create a file for read/write Destroy contents Create new "a+" append extended Open a file for read/write Write to end Create new Additionally, "x" can be added, which forces the function to fail if the file exists. "t" can be added to force text mode (which is the default), where '\n', '\t', etc. are escaped into the relevant characters. "b" can be added to force binary mode where characters are not escaped. To open a file, we need to call fopen, which has the following signature: FILE* fopen(const char* filename, const char* mode); This return a pointer to a file handle, and requires a filename and a mode from the table above. Once we are done with a file handle, we can close it using fclose, which has the signautre: int fclose(FILE* stream); fclose returns 0 on success and EOF on fail. A string can be written to a file using fputs or fprintf, which have the following signatures: int fputs(const char* str, FILE* stream);
int fprintf(FILE* stream, const char* format, ...); fprintf is identical to printf, but accepts a file handle instead of using stdout. The same '%' arguments can be used in any standard library function ending in printf. To write a single character, use fputc: int fputc(int ch, FILE* stream); Reading a file is a bit more complicated. It is possible to read single characters using fgetc: int fgetc(FILE* stream); However, it is often easier to read the whole file at once. In this case, it is easier to create a function to read a whole file: char* read_file(const char* filepath)
{ FILE* file = fopen(filepath, "rt"); // open the file fseek(file, 0, SEEK_END); // go to the end of the file unsigned long length = ftell(file); // get the current position (aka the length of the file) char* data = (char*)malloc(length + 1); // allocate the string memset(data, 0, length + 1); // clear the string rewind(file); // go to start of file fread(data, 1, length, file); // read in the data fclose(file); // close the file return file; // return our string
} This function can be called by supplying a file name. The string returned must be cleaned up using free once it is no longer needed.

