A function begins with it's prototype. The prototype describes a few key features of a function: Its name Its return type Its parameters Let's take a look at main as an example: int main(int argc, char** argv); This version of main expects an integer and an array of strings, and returns an integer. Another example is printf: int printf(const char* format, ...); This function expects a string, as well as what is called 'variadic arguments'. This means that the number of arguments supplied after the string is variable, and in the case of printf is equal to the number of '%' arguments inside the format string. printf returns an integer which, on success, returns the number of characters written (this is often ignored as it is printf should never fail on a normal system). A full function definition is a function prototype followed by a block: int main()
{ // block
}

