Functions can accept and produce data. This can be very useful for abstracting complex processes such as reading in files or performing calculations. This data has to be specified in the prototype. This is where arguments (parameters) and return types come in. An argument is data supplied to a function and must match the parameter in the funciton. For example: // accepts 2 integers, returns an integer
int add(int a, int b)
{ // must match return type return a + b;
} int main()
{ // must pass 2 integers // result is an integer int result = add(3, 5);
} The return type of a function is a single value that is produced when the function is run. When a return is executed, it must match the return type, and causes the function to exit and produce the value returned. In the case of a function returning void, no value is given during return as there is no return type. Another method of returning values is using return paremeters. These are pointers to values, which the function modifies before returning. This can be useful if the function returns multiple values (e.g. if the function returns data and an exit code). void add(int* result, int a, int b)
{ *result = a + b;
} int main()
{ int result; add(&result, 3, 5);
}

