Functions can be defined and declared. So what is the difference between the two and what are they used for? A declaration is simply a function prototype followed by a semicolon: int add(int a, int b); A definition is a function prototype followed by a scope: int add(int a, int b)
{ return a + b;
} A definition also counts as a declaration. This can be useful, because a function that has been declared can then be defined later. In C, functions can only be used once they have been declared (any code above the declaration can't use the function). Declaring a function before it is defined can be used if two function each depend on eachother, or to create external linkage. Functions do not need to be declared in the same file they are defined. This means we can declare a function in a 'header file' (.h file), which we can #include into a 'source file' (.c file). The definition can live inside any source file. This will work as long as all source files are compiled and linked together. This leads to more complex compiling, and may require a makefile, but leads to a much more organised project. This will be covered in the next chapter.
